export const getChargeData = () => chargeData;

export const getDataSummary = () => ({
    totalRecords: chargeData.length,
    exporters: [...new Set(chargeData.map(item => item['Exporter Clean']))],
    lotids: [...new Set(chargeData.map(item => item.Lotid))],
    chargeTypes: [...new Set(chargeData.map(item => item.Chargedescr))]
});

// Calculate metrics for analysis
export const calculateMetrics = () => {
    const lotidTotals = {};
    
    // Excluded charge types
    const excludedCharges = ['GROWER ADVANCES'];
    
    // Group charges by Lotid and calculate totals (exclude Videxport, Del Monte, and specified charges)
    chargeData
        .filter(row => row['Exporter Clean'] !== 'Videxport' && row['Exporter Clean'] !== 'Del Monte')
        .filter(row => !excludedCharges.includes(row.Chargedescr))
        .forEach(row => {
        const lotid = row.Lotid;
        const amount = parseFloat(row.Chgamt) || 0;
        const initialStock = parseFloat(row['Initial Stock']) || 0;
        
        if (!lotidTotals[lotid]) {
            lotidTotals[lotid] = {
                lotid,
                exporter: row['Exporter Clean'],
                totalChargeAmount: 0,
                initialStock,
                charges: []
            };
        }
        
        lotidTotals[lotid].totalChargeAmount += amount;
        lotidTotals[lotid].charges.push({
            description: row.Chargedescr,
            amount,
            quantity: parseFloat(row.Chgqnt) || 0
        });
    });
    
    // Calculate cost per box for each lotid
    Object.values(lotidTotals).forEach(lotid => {
        lotid.costPerBox = lotid.initialStock > 0 ? 
            lotid.totalChargeAmount / lotid.initialStock : 
            null; // Handle division by zero
    });
    
    return lotidTotals;
};
